import {Link} from 'react-router-dom';



const Navbar = () => {
  return (
    // <nav classNameName="flex items-center justify-between flex-wrap text-white bg-neutral-focus py-4 px-3 sm:px-16">
    //     <div className='font-semibold'>
    //         Breaking Bad
    //     </div>
    //     <div>
    //         <Link to='/' className='btn btn-ghost btn-md mr-1 hover:bg-blue-700'>
    //             Home
    //         </Link>
    //         <Link to='/acteurs' className='btn btn-ghost btn-md hover:bg-blue-700'>
    //             Acteurs
    //         </Link>
    //     </div>
        
    // </nav>

    <div className="navbar bg-info-content text-white px-4">
        <div className="flex-1">
            <p className="normal-case text-xl">Breaking Bad</p>
        </div>
        <div className="flex-none gap-2">
            <div className="form-control">
                <input type="text" placeholder="Rechercher" className="input-sm input-bordered" />
            </div>
            <div className="dropdown dropdown-end">
                <label tabindex="0" className="btn btn-ghost btn-circle avatar">
                    <div className="w-10 rounded-full">
                        <img src="https://api.lorem.space/image/face?hash=33791" />
                    </div>
                </label>
                <ul tabindex="0" className="mt-3 p-2 shadow menu menu-compact dropdown-content bg-base-100 rounded-box w-52">
                    <li>
                        <a className="justify-between">
                            Profile
                            <span className="badge">New</span>
                        </a>
                    </li>
                    <li><a>Settings</a></li>
                    <li><a>Logout</a></li>
                </ul>
            </div>
        </div>
    </div>
  )
}

export default Navbar
